                "title": "Personalized Pregnancy & Wedding Announcements",
                "announcement": "Thank you for visiting S&#39;Berry Boutique!\n\nS&#39;Berry Boutique, LLC is an online boutique that features a wide range of products that focus mainly around major life events, such as wedding and pregnancy announcements. Each product is made by Erica & Ian Stokesberry in their home studio. By purchasing from S&#39;Berry Boutique, you are supporting a couple that has such passion behind everything that they make and hopes you love their products just as much as they love to create them.\n\nOur Vision and Mission\nAt S&#39;Berry Boutique, customer satisfaction is equal to our success. You will always find us striving to offer extraordinary customer service. Our primary goal is to make sure every customer has a great experience with S&#39;Berry Boutique, because we wouldn&#39;t be here without you!\n\nWhy Choose S&#39;Berry Boutique?\nAt S&#39;Berry Boutique, you&#39;re sure to find the perfect way to announce the important moments in your life! We truly value our clients and their faith in us and therefore, please send us a message if you have any questions.",
                "currency_code": "USD",
