                "vacation_message": "S&#39;Berry Boutique, LLC is currently on vacation until 9/13/19. All orders previously placed will be completed and shipped on time! Please visit us back on 9/13/19.\r\n\r\n\r\nThank you,\r\nErica & Ian Stokesberry\r\nS&#39;Berry Boutique, LLC",
                "sale_message": "Thank you for your purchase! Your business means so much to us!\r\n\r\nIf you would like to show off your order on social media, please be sure to tag us and use #sberryboutique\r\n\r\n\r\nAlso, be sure to follow S&#39;Berry Boutique, LLC on social media for important updates, new products listed, and to support show your support for our small business:\r\n\r\nFacebook: www.facebook.com/sberryboutique\r\nInstagram: www.instagram.com/sberryboutique\r\nTwitter: www.twitter.com/sberrybllc\r\n\r\n\r\n",
                "digital_sale_message": "Thank you for your purchase! If you have any questions, please don&#39;t hesitate to contact us! \r\n\r\n***THIS IS A DIGITAL DOWNLOAD, NO PHYSICAL ITEM WILL BE SHIPPED TO YOU***\r\n\r\nPlease note that all digital files are for PERSONAL USE ONLY. File sharing, distributing, or selling the designs, or ANY elements within them, in any other format including templates, websites, brochures, advertising or on any products is strictly prohibited. When purchasing a product you agree to use the designs for personal use only. Commercial use is not allowed.\r\n\r\nThank you,\r\nErica & Ian Stokesberry\r\nS&#39;Berry Boutique, LLC",
