                "accepts_custom_requests": true,
                "policy_welcome": "About SâBerry Boutique\r\n\r\nS&#39;Berry Boutique, LLC (formerly Creative Pika, LLC) is an online store that \r\nfeatures a wide range of products. Each product is made by Ian & Erica Stokesberry \r\nin their home studio. Ian and Erica like to support other handmade shops by using \r\nsome their designs, with their permission of course, to create custom products like \r\nmugs, puzzles, shot glasses, ornaments and more.\r\n \r\nBy purchasing from S&#39;Berry Boutique, you are supporting a couple that has such \r\npassion behind everything that they make and hopes you love their products just as \r\nmuch as they do.\r\n \r\nOur Vision and Mission\r\n\r\nAt S&#39;Berry Boutique, customer satisfaction is equal to our success. You will always \r\nfind us striving to offer extraordinary customer service. Our primary goal is to make sure \r\nevery customer has a great experience with S&#39;Berry Boutique, because we wouldn&#39;t \r\nbe here without you!\r\n \r\nWhy Choose S&#39;Berry Boutique?\r\nAt S&#39;Berry Boutique, you&#39;re sure to find the perfect gift for anyone! We truly value \r\nour clients and their faith in us and therefore, please send us a message if you have \r\nany questions.",
                "policy_payment": "My shop accepts credit cards, and Paypal. All Colorado orders will have Colorado sales tax applied during checkout.",
                "policy_shipping": "-------------------------------------------\r\n- - SHIPPING WITHIN THE U.S. - -\r\n-------------------------------------------\r\n\r\nPROCESSING TIME (BEFORE SHIPPING)\r\n1 business day (excludes weekends)\r\n\r\n- - SHIPPING OPTIONS - -\r\n USPS FIRST CLASS MAIL\r\n2-5 business days (excludes weekends)\r\n(approximate estimate only and not a guaranteed time-frame)\r\n\r\nUSPS PRIORITY MAIL\r\n1-3 business days (excludes weekends)\r\n(approximate estimate only and not a guaranteed time-frame)\r\n\r\nUSPS PRIORITY MAIL EXPRESS\r\n1-2 business days (excludes weekends)\r\n(USPS guarantees delivery in up to 2 business days)\r\n\r\n------------------------------------\r\nDISCLAIMER: SâBerry Boutique, LLC cannot guarantee the arrival of packages by a specific date, due to the possibility of delays by the USPS. Once the USPS has the package in their hands, they can delay the shipment for reasons beyond our control. Please be sure to read our full shipping policy in the âShippingâ section of our shop. By purchasing, you are agreeing to our full store policies. Please contact us if you have any questions.\r\n-------------------------------------\r\n\r\n\r\n------------------------------------------\r\n- - SHIPPING INTERNATIONAL - -\r\n------------------------------------------\r\n\r\nPROCESSING TIME (BEFORE SHIPPING)\r\n1 business day (excludes weekends)\r\n\r\n*We offer international shipping on some items in our shop. All shipping time-frames are estimates only and not guaranteed time-frames.\r\n\r\nUSPS FIRST CLASS MAIL\r\n2-3 business weeks (excludes weekends)\r\n(approximate estimate only and not a guaranteed time-frame)\r\n\r\nUSPS PRIORITY MAIL\r\n6-10 business days (excludes weekends)\r\n(approximate estimate only and not a guaranteed time-frame)\r\n\r\nUSPS PRIORITY MAIL EXPRESS\r\n3-5 business days (excludes weekends)\r\n(USPS guarantees delivery in up to 5 business days)\r\n\r\nIMPORTANT NOTE: International buyers are responsible for any and all Customs Charges, Taxes & Additional Postal Fees\r\n\r\n------------------------------------\r\nDISCLAIMER: SâBerry Boutique, LLC cannot guarantee the arrival of packages by a specific date, due to the possibility of delays by the USPS. Once the USPS has the package in their hands, they can delay the shipment for reasons beyond our control. Please be sure to read our full shipping policy in the âShippingâ section of our shop. By purchasing, you are agreeing to our full store policies. Please contact us if you have any questions.\r\n-------------------------------------\r\n\r\n-----------------------------------------------------\r\nADDITIONAL SHIPPING INFORMATION\r\n-----------------------------------------------------\r\n\r\nS&#39;Berry Boutique, LLC won&#39;t be held responsible due to delays from weather-related and other natural disasters or events.\r\n\r\nAll orders will contain a tracking number. Please make sure to track your package to get a better estimate of knowing when it will arrive. We are unable to refund or resend the item due to loss after confirmation of delivery. S&#39;Berry Boutique, LLC won&#39;t be held responsible for items that have been delivered by the Postal Service and you didn&#39;t receive it. Please confirm your shipping address is correct prior to placing an order. \r\n\r\nPlease remember that shipping around any holiday can be very unpredictable and shipping upgrades are recommended to ensure faster delivery times.",
                "policy_refunds": "S&#39;Berry Boutique, LLC Return Policy\r\n\r\nWHAT YOU CAN RETURN\r\n\r\nContact S&#39;Berry Boutique, LLC immediately if your item arrived damaged/broken (photo proof is required of the product and all of its packaging, including the shipment box).\r\nS&#39;Berry Boutique, LLC will only accept returns within 14 days of delivery confirmation on items in new condition, with the original packaging and materials, including gift boxes. Below is a list of what items we won&#39;t accept for returns:\r\n\r\n\r\nWHAT YOU CAN&#39;T RETURN\r\n\r\nUnfortunately, S&#39;Berry Boutique, LLC is unable to accept certain items for return.\r\n\r\nThese include:\r\n\r\nâ¢Items which are no longer in new condition.\r\nâ¢Items which lack their original packaging, including gift boxes.\r\nâ¢Items which have been customized or altered to meet customer specifications, like special/custom orders and personalized orders.\r\nâ¢Items which have been in the customer&#39;s possession for more than 14 days from the date the item was delivered.\r\n\r\nWHAT YOU NEED TO KNOW IF YOUR ORDER IS ELIGIBLE FOR A RETURN/REFUND\r\n\r\nâ¢S&#39;Berry Boutique, LLC is not responsible for items that aren&#39;t received after confirmation of delivery.\r\nâ¢Be sure to inspect your items promptly upon receipt. Contact S&#39;Berry Boutique, LLC immediately if your item arrived damaged/broken (photo proof is required of the product and all of its packaging, including the shipment box).\r\nâ¢If the item is being returned for any reason other than damaged or you were unsatisfied with your purchase, the shipping fees related to the returned item are the customer&#39;s responsibility. This includes fees to return the item to our facility as well as fees related to shipping a replacement item to the customer, when applicable.\r\nâ¢We advise all customers to return their items via a carrier (like USPS, UPS or FedEx) that provides a tracking number. Return shipments which are lost in transit are not the responsibility of S&#39;Berry Boutique, LLC.\r\nâ¢We inspect all returned items within 2-5 business days of receipt. Any item that is received in a condition which is not new or which does not include all of its original packaging, including gift boxes, will be returned to the customer or the fees for the missing items will be deducted from the refund.\r\nâ¢After the product&#39;s original condition has been verified, we will issue a refund, store credit or perform an exchange. Most refunds are processed within 5-10 business days of receipt.\r\nâ¢Refunds will be issued in the original form of payment.\r\nâ¢Unless the item is returned due to a damaged or you were unsatisfied with your purchase, the original shipping fees associated with your order will not be refunded.",
