                "policy_privacy": "Privacy Policy \n  \nProtecting your private information is our priority. This Statement of Privacy applies to www.sberryboutiqueshop.etsy.com and S&#39;Berry Boutique, LLC and governs data collection and usage. For the purposes of this Privacy Policy, unless otherwise noted, all references to S&#39;Berry Boutique, LLC include www.sberryboutiqueshop.etsy.com and S&#39;Berry Boutique. The S&#39;Berry Boutique website is a S&#39;Berry Boutique Etsy Shop site. By using the S&#39;Berry Boutique website, you consent to the data practices described in this statement. \n  \nCollection of your Personal Information \nIn order to better provide you with products and services offered on our Site, S&#39;Berry Boutique may collect personally identifiable information, such as your: \n  \n -\tFirst and Last Name \n -\tMailing Address \n -\tE-mail Address \n -\tPhone Number \n  \nPlease keep in mind that if you directly disclose personally identifiable information or personally sensitive data through S&#39;Berry Boutique&#39;s public message boards, this information may be collected and used by others. \n  \nWe do not collect any personal information about you unless you voluntarily provide it to us. However, you may be required to provide certain personal information to us when you elect to use certain products or services available on the Site. These may include: (a) registering for an account on our Site; (b) entering a sweepstakes or contest sponsored by us or one of our partners; (c) signing up for special offers from selected third parties; (d) sending us an email message; (e) submitting your credit card or other payment information when ordering and purchasing products and services on our Site. To wit, we will use your information for, but not limited to, communicating with you in relation to services and/or products you have requested from us. We also may gather additional personal or non-personal information in the future. \n  \nUse of your Personal Information \nS&#39;Berry Boutique collects and uses your personal information to operate its website(s) and deliver the services you have requested. \n  \nS&#39;Berry Boutique may also use your personally identifiable information to inform you of other products or services available from S&#39;Berry Boutique and its affiliates. \n  \nSharing Information with Third Parties \nS&#39;Berry Boutique does not sell, rent or lease its customer lists to third parties. \n  \nS&#39;Berry Boutique may share data with trusted partners to help perform statistical analysis, send you email or postal mail, provide customer support, or arrange for deliveries. All such third parties are prohibited from using your personal information except to provide these services to S&#39;Berry Boutique, and they are required to maintain the confidentiality of your information. \n  \nS&#39;Berry Boutique may disclose your personal information, without notice, if required to do so by law or in the good faith belief that such action is necessary to: (a) conform to the edicts of the law or comply with legal process served on S&#39;Berry Boutique or the site; (b) protect and defend the rights or property of S&#39;Berry Boutique; and/or (c) act under exigent circumstances to protect the personal safety of users of S&#39;Berry Boutique, or the public. \n  \nTracking User Behavior \nS&#39;Berry Boutique may keep track of the websites and pages our users visit within S&#39;Berry Boutique, in order to determine what S&#39;Berry Boutique services are the most popular. This data is used to deliver customized content and advertising within S&#39;Berry Boutique to customers whose behavior indicates that they are interested in a particular subject area. \n  \nAutomatically Collected Information \nInformation about your computer hardware and software may be automatically collected by S&#39;Berry Boutique. This information can include: your IP address, browser type, domain names, access times and referring website addresses. This information is used for the operation of the service, to maintain quality of the service, and to provide general statistics regarding use of the S&#39;Berry Boutique website. \n  \nLinks \nThis website contains links to other sites. Please be aware that we are not responsible for the content or privacy practices of such other sites. We encourage our users to be aware when they leave our site and to read the privacy statements of any other site that collects personally identifiable information. \n  \nSecurity of your Personal Information \nS&#39;Berry Boutique secures your personal information from unauthorized access, use, or disclosure. S&#39;Berry Boutique uses the following methods for this purpose: \n  \n  \nWe strive to take appropriate security measures to protect against unauthorized access to or alteration of your personal information. Unfortunately, no data transmission over the Internet or any wireless network can be guaranteed to be 100% secure. As a result, while we strive to protect your personal information, you acknowledge that: (a) there are security and privacy limitations inherent to the Internet which are beyond our control; and (b) security, integrity, and privacy of any and all information and data exchanged between you and us through this Site cannot be guaranteed. \n  \nChildren Under Thirteen \nS&#39;Berry Boutique does not knowingly collect personally identifiable information from children under the age of thirteen. If you are under the age of thirteen, you must ask your parent or guardian for permission to use this website. \n  \nE-mail Communications \nFrom time to time, S&#39;Berry Boutique may contact you via email for the purpose of providing announcements, promotional offers, alerts, confirmations, surveys, and/or other general communication. \n  \nChanges to this Statement \nS&#39;Berry Boutique reserves the right to change this Privacy Policy from time to time. We will notify you about significant changes in the way we treat personal information by sending a notice to the primary email address specified in your account, by placing a prominent notice on our site, and/or by updating any privacy information on this page. Your continued use of the Site and/or Services available through this Site after such modifications will constitute your: (a) acknowledgment of the modified Privacy Policy; and (b) agreement to abide and be bound by that Policy. \n  \nContact Information \nS&#39;Berry Boutique welcomes your questions or comments regarding this Statement of Privacy. If you believe that S&#39;Berry Boutique has not adhered to this Statement, please contact S&#39;Berry Boutique at: \n  \nS&#39;Berry Boutique, LLC \nPO Box 163 \nElizabeth, Colorado 80107 \n  \nEmail Address: \nsberryboutiquellc@gmail.com \n  \nTelephone number: \n(866)865-2187 \n  \nEffective as of August 01, 2018",
