            "listing_id": 712671847,
            "title": "Glock 48 IWB holster - Steel Gray (other colors available) - InvisiHolsters",
            "description": "Unless you tell us otherwise, this holster will come in Steel Gray. We also offer the following other color options: Black, Coyote Brown, Ranger Green, Red, Royal Blue (Police Blue), Hot Pink, Desert Tan, Purple, and Tiffany Blue. If you would like a color other than Steel Gray, please let us know in the note section when you order.\n\nFEATURES:\n- This is an inside-the-waistband (IWB) holster. It is not designed for open carry.\n- Made with sturdy yet concealable .08â thick kydex or boltaron.\n- Crafted by hand in the U.S.A. (Midland, Michigan).\n- Ejection port is blocked out completely to prevent shavings that can scratch your pistol.\n- All retention is on the trigger guard where it belongs, and retention is adjustable with a turn of a screw.\n- Your choice of clip depending on your needs.\n- Holsters with special printed patterns have graphics infused into the top layer of the holster. These graphics do not scratch off.\n- Lifetime Warranty for parts and workmanship.\n\n\nCHOICE OF CLIPS:\n\nTUCKABLE CLIP: \nThe Tuckable Clip is made out of a nylon polymer and can handle belts up to 1 1/2â wide. (We have a larger version that can handle belts up to 1 3/4&quot; wide. Message us if you need the larger clip.) The clip is placed under the trigger guard rather than on the flat side of the holster. This helps keep the handle of the pistol close to the body and increases concealability. Cant (angle) can easily be adjusted. Holsters can be switched between left handed and right handed shooters as the clip can easily be moved to the opposite side of the holster. \n\n\nNON-TUCKABLE CLIP: \nThe Non-Tuckable Clip is made out of a durable nylon polymer and can handle belts up to 1 1/2â wide. (We also have a larger clip of the same design that can handle belts as wide as 1 3/4â. Send us a note if you would like the larger clip.) It grips tightly to the belt, and can handle the tightest retention settings. The bottom portion of this clip is angled in such a way that allows it to push down over your belt with downward force. However, once the clip is in place over your belt, it hooks under your belt securely. Note: Non-Tuckable holsters cannot be adjusted for cant or handedness. If you have a right handed holster made, it cannot be changed into a left handed holster (and vice versa).\n\n\nULTICLIP: \nWe use the Ulticlip-3, which is made out of spring steel. Itâs ability to tightly clamp fabric has made it one of the most popular methods for beltless carry. This clip is the thinnest of our offerings, yet it is the most durable. The clip is placed under the trigger guard rather than on the flat side of the holster. This helps keep the handle of the pistol close to the body and increases concealability. \n\nFABRICLIP: \nThe Fabriclip is another great beltless carry option that we have added due to popular request. It is thin and is highly concealable. Due to its larger footprint, it is placed on the flat side of the holster rather than under the trigger guard.\n\n(Note: Images are examples only. The holsters in our images could be for a pistol different than the item listed. Also, as we get feedback from customers, our design is changing over time. We will be changing our pictures as time permits. If a pistol is pictured, it does not come with the holster.) \n\nWe can make any of our holsters for the following pistols:\n\nBeretta Nano\nBeretta Pico\nCZ P07, Gen 2\nCZ P10C\nCZ 2075 Rami w/ safety\nFNH FNS 9/40, full size\nFNH FNS Compact 9/40\nFN 509\nGlock 17 / 22 / 31, Gen 3/4\nGlock 17 / 22 / 31 w/ Streamlight TLR-1, Gen 3/4\nGlock 19 / 23 / 32 , Gen 3/4\nGlock 19 / 23 / 32 , Gen 5\nGlock 19 / 23 / 32 w/ Streamlight TLR-1, Gen 3/4\nGlock 26 / 27 / 33, Gen 3/4\nGlock 30s\nGlock 36\nGlock 42\nGlock 42 w/ TLR-6 Light\nGlock 43\nGlock 43 w/ TLR-6 Light\nHK VP9\nHonor Defense Honor Guard, 9mm\nKahr CW9\nKahr PM9\nKimber Micro Carry/CDP (NO LASER), 380\nKimber Micro 9\nRuger American Compact 9mm\nRuger LCP (NO LASER), 380\nRuger LCP II, 380\nRuger LC9 / LC9S\nRuger LCR .38\nRuger SR9C (Compact)\nRuger SR40 (Full Size)\nRuger SR40C (Compact)\nSig Sauer P238\nSig Sauer P239\nSig Sauer P320 Full Size 9/40\nSig Sauer P320 Compact 9/40\nSig Sauer P320 Compact 45 ACP\nSig Sauer P320 Subcompact (WITHOUT RAIL) 9/40\nSig Sauer P320 Subcompact (WITH RAIL) 9/40\nSig Sauer P365\nSig Sauer P938\nSmith & Wesson M&P 9/40 (4.25&quot; barrel, Full Size)\nSmith & Wesson M&P 9C/40C (3.5&quot; barrel, Compact)\nSmith & Wesson M&P 45C (4&quot; barrel, Compact)\nSmith & Wesson M&P Shield 9/40, (1.0 and 2.0)\nSmith & Wesson M&P Shield 45\nSmith & Wesson M&P Shield 2.0 w/ Integrated CT Laser\nSmith & Wesson M&P Shield 380 EZ\nSmith & Wesson M&P 2.0 9/40 (4.25&quot; barrel)\nSmith & Wesson M&P 2.0 Compact 9/40 (4&quot; barrel)\nSmith & Wesson J Frame 442/642\nSmith & Wesson SW9VE\nSpringfield XD Subcompact (3&quot; barrel) 9/40\nSpringfield XD Subcompact MOD 2 (3&quot; barrel) 9/40\nSpringfield XD Subcompact MOD 2, 45 ACP (3.3&quot; barrel)\nSpringfield XD Service Model (4&quot; barrel) 9/40\nSpringfield XD Service model MOD 2 (4&quot; barrel) 9/40\nSpringfield XDM 3.8, 9/40\nSpringfield XDM 4.5, 9/40\nSpringfield XDS 3.3, 9/40/45\nSpringfield XDS Mod 2 3.3 9/40/45\nSpringfield XDS 4.0, 9/40/45\nTaurus G2C\nTaurus G2S\nTaurus PT 111/140 G2, 9/40\nWalther CCP\nWalther Creed\nWalther PPK, PPK/s\nWalther PPS M2, 9\nWalther PPQ 45\n1911, government, full-size, 5&quot; barrel (no rail)\n\nNote: All tuckable and non-tuckable clips now have &quot;InvisiHolsters&quot; engraved on them.",
