                "policy_refunds": "I GLADLY ACCEPT CANCELLATIONS\nRequest a cancellation within: 1 hour of purchase\n\nI DON'T ACCEPT RETURNS OR EXCHANGES\nBut please contact me if you have any problems with your order.",
                "policy_additional": "CUSTOM AND PERSONALISED ORDERS\nAll items on display are examples only - I make every item to order, which is why the form in &#39;personalisation&#39; is so important.\nI cannot guarantee I will include every single detail provided on the forms, but I do my best to create a simple, colourful and accurate chibi-style model. Some items are harder to create than others - for example a sword or a staff is easier than a flag or weapon held out. I tend to put the models in a neutral position as weapons drawn are very easy to snap, either in transit or when being used to play with. I can offer weapons drawn or more complex designs upon request, and I ship with utmost care, but this would be at the buyer&#39;s risk.\nPolymer is, however, very easily repaired with easily accessible super-glue.\n\nSIZING DETAILS\nI use a hero-forge human/monk miniature to base my sizes off. The base is a circle, approximately 1-inch in diameter. The height of the model will depend on the race of the character being designed - for example gnomes are usually the shortest race, and Half-Orcs are the tallest. I take into account height on the order form.\nMost models appear quite chubby, as slender models do not bake well in the oven/can droop due to the large head style.\n\nGIFT WRAPPING AND PACKAGING\nI do not offer gift-wrapping. Models are sent in a tub similar to a film canister, in a parcel bag. This ensures they remain intact during shipping. If any part of the model becomes detached, normally it is very easy to stick back together with super glue.\n\nDO YOU DO MODELS FOR OTHER GAMES?\nYes, I am confident I could make a model for another game, but I would need to have much more information, perhaps even a reference picture.",
